import React, { Component } from 'react';
import BoxInfoImportante from './boxes/BoxInfoImportante';
import BoxUsuario from './boxes/BoxUsuario';
import BoxLogin from './boxes/BoxLogin';

class App extends Component {
   render() {
      return (
         <div className="container">
            <h1 className="text-center">Documentação Da Api</h1>

            <div className="alerta text-center font-weight-bold font-italic"
               style={{marginTop:20+"px", marginBottom:20+"px"}}>
               Sempre que derem um pull, não se esqueçam de rodar o script do banco pra poderem ficar igual ao bomba patch, 100% atualizado!!!
            </div>
 
            <div id="outterAccordion">
               
               <BoxInfoImportante/>
               <BoxUsuario/>
               <BoxLogin/>

            </div>
         </div>
      );
   }
}

export default App;
